import React, { useState } from "react";
import { HeaderLinks, Icons } from "./Constants";
import {
  ToggleMenu,
  ToggleClose,
  ToggleMenuItems,
  ToggleMenuMain,
  ToggleButton,
  ToggleButtonLines,
  ToggleButtonLine,
  ToggleNavLink,
  IconLi,
  Icon
} from "./Fragments";

const ToggleNav = () => {
  const [toggle, setToggle] = useState(false);
  return <>{toggle && <div>Hello</div>}</>;
};
export default ToggleNav;
